        int dMin = (p.getTiempoDesMin() / p.getTamanoSlots());
        int pMin = (p.getTiempoPosMin() / p.getTamanoSlots()) * 3;
        int pOptMe = ((p.getTiempoPosOpt() / p.getTamanoSlots()) * 3) - 2;
        int pOptMa = ((p.getTiempoPosOpt() / p.getTamanoSlots()) * 3) + 2;
        int tOptMe = ((p.getTiempoTrabOpt() / p.getTamanoSlots()) * 3) - 3;
